//生成饼图的n个div
function piediv(st,en,poN){
  //清空div
  document.getElementById("littlepie").innerHTML = "";
  //生成div
  for(let i=st;i<en;i++){
    let node=document.createElement("DIV");
    let att1=document.createAttribute("id");
    att1.value=`littlepie_${i}_${poN}`;
    let att2=document.createAttribute("style");
    att2.value=`height:20px;width:20px;float:left`;
    let att3=document.createAttribute("onclick");
    att3.value=`youshangLittlepieClick(this)`;
    node.setAttributeNode(att1);
    node.setAttributeNode(att2);
    node.setAttributeNode(att3);
    // node.appendChild(att2);
    // console.log(node);
    document.getElementById("littlepie").appendChild(node);
  }
}
