//绘图函数,传入data和绘制id，生成图表
function piesite(data,id){
  // console.log(data);
  // console.log(id);
  let Dompie = document.getElementById(id);
  let ChartPie = echarts.init(Dompie);
  var optionPie;
    optionPie = {
      tooltip: {
          trigger: 'item',
          formatter: '{a} <br/>{b}: {c} ({d}%)'
      },
      color:["#939393","#939393"],
      series: [
          {
              color:['#FFF2C5','#BADEEC','#F30e1C','#1823EB'],
              name: '极性',
              type: 'pie',
              selectedMode: 'single',
              radius: [0, '40%'],
              center:["50%","55%"],
              label: {
                  show:false,
              },
              labelLine: {
                  show: false
              },
              data:data[1]
          },
          {
              color:[' #333EA3',"#4769A8",'#87BCDA','#D0E6EC','#FDEDA8','#FAAF67',],
              name: '亲疏水性',
              type: 'pie',
              radius: ['60%', '80%'],
              center:["50%","55%"],
              
              label: {
                  show:false,
              },
              data: data[0]
          }
      ]
    };
    // ChartPie.on('click', function (params) {
    //   console.log(params);
    // });
  ChartPie.setOption(optionPie);
}
